			<div className='card-body'>
				<h5 className='card-title'>{props.ProductCard.title}</h5>
				<p className='card-text'>{props.ProductCard.descr}</p>
				<a href="#" className='btn btn-primary'>Go somewhere</a>
			</div>
		</div>
	)
}
